import React from 'react'
import ServiceCard from './ServiceCard';
import { Col } from 'reactstrap';

import weatherImg from '../assets/images/weather.png';
import guideImg from '../assets/images/guide.png';
import customizationImg from '../assets/images/customization.png';

const servicesData = [
    {
      imgUrl: weatherImg,
      title: 'Weather Forecast',
      description: 'Get real-time weather updates for your chosen location.',  
    },
    {
      imgUrl: guideImg,
      title: 'Tour Guide',
      description: 'Book a private tour guide to help you plan your visit.',
    },
    {
      image: customizationImg,
      title: 'Customization',
      description: 'Tailor your tour experience to your preferences.',
    },
  ];


const ServiceList = () => {
  return  <>
    {
       servicesData.map((item, index)=> <Col lg='3' key={index}> <ServiceCard item={item} /></Col>)
    }
  </>
  
}

export default ServiceList
